import './App.css';
import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './containers/Home';

const App = () => {
  return (
    <div className="App">
      <Switch>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </div>
  );
};

export default App;
